import React, { useEffect, useState } from 'react';

const Doggie = () => {
    const url = "https://api.thedogapi.com/v1/images/search?limit=16";
    const [dogs, setDogs] = useState([]);

    useEffect(() => {
        fetch(url)
            .then(response => response.json())
            .then(data => {
                setDogs(data);
            });
    }, []);
    return (
        <>
            <div className="App">
                {data && data.map((dog) => <img width={"200px"} height={"200px"} src={dog}></img>)}
            </div>
        </>
    );
}

export default Doggie;
